var qlines = [];

var XV = [1,0];
var YV = [0.7071,-0.7071];
var ZV = [0,-1];
var WV = [-0.7071,-0.7071];

var VS = 20;

var XY=0,XZ=0,XW=0,YZ=0,YW=0,ZW=0;

var ox=0,oy=0;

